@-moz-document url-prefix("https://www.youtube.com/")

{
/*Sidebar icons*/
ytd-guide-entry-renderer[active] .guide-icon.ytd-guide-entry-renderer {
      fill: #e08517 !important;
}

.ytp-play-progress,
  .ytp-scrubber-button.ytp-swatch-background-color,
  #notification-count,
  #subscribe-button > ytd-subscribe-button-renderer > paper-button,
  paper-button.ytd-subscribe-button-renderer,
  .style-scope.ytd-thumbnail-overlay-resume-playback-renderer,
  .ytp-menuitem[aria-checked="true"] .ytp-menuitem-toggle-checkbox,
  paper-toggle-button[checked]:not([disabled]) .toggle-bar.paper-toggle-button,
  #progress{
      background-color: #e08517 !important;
}

 /*Live Now badge, Player settings quality text */

  .badge-style-type-live-now.style-scope.ytd-badge-supported-renderer,
  .ytp-swatch-color {
      color: #66BB6A !important;
      border-color: #e08517;
  }
  /*Sub-button text*/

  paper-button.ytd-subscribe-button-renderer {
      color: #DAF0FF !important;
  }
  /*Player quality badges [OLD]*/

  .ytp-red2 .ytp-settings-button.ytp-hd-quality-badge:after,
  .ytp-red2 .ytp-settings-button.ytp-4k-quality-badge:after,
  .ytp-red2 .ytp-settings-button.ytp-5k-quality-badge:after,
  .ytp-red2 .ytp-settings-button.ytp-8k-quality-badge:after,
  .ytp-red2 .ytp-settings-button.ytp-3d-badge:after {
      background-color: #e08517 !important;
  }
  /*Player quality badges*/

  .ytp-settings-button.ytp-hd-quality-badge:after,
  .ytp-settings-button.ytp-4k-quality-badge:after,
  .ytp-settings-button.ytp-5k-quality-badge:after,
  .ytp-settings-button.ytp-8k-quality-badge:after {
      background-color: #e08517 !important;
  }
  /*Volume slider*/

  .ytp-volume-slider-handle:before,
  .ytp-volume-slider-handle {
      background-color: #e08517 !important;
  }
  .ytp-volume-slider-handle:after {
      background-color: #8F9091 !important;
      z-index: -1;
  }
  /*Youtube Logo*/

  #logo-icon-container > svg > g > g:nth-child(1) > path {
      fill: #e08517 !important;
  }

  /*Live icon*/
  .yt-icon {
      color: #e08517!important;
  }

/*================================================================

	   Black color Pornhub
================================================================*/

:root {
    --white: #fff5f5;
    --grey-100: #fff;
    
    --grey-750: #fff;
    --grey-850: #121212;
    
    --red-700: #8e0b0b;
	
	--green-like: #5ba904;
	--red-dislike: #820000;
	
	--no-sub: #ff0000;
	--already-sub: #1a1a1a;

    /* Custom color video player */
    --mycolor: #353535;

    --standard-curve: cubic-bezier(0.4, 0.0, 0.2, 1);
}

/* Background */
ytd-page-manager > *.ytd-page-manager {
    background: #000;
}

#container.ytd-masthead {
    background: #1b1b1b;
}

#guide-content.ytd-app {
    background: #1b1b1b;
}

#columns.ytd-watch-flexy {
    background: #000;
}
/* ************************************* */

#channel-header.ytd-c4-tabbed-header-renderer {
    background-color: #000;
}

#tabs-inner-container.ytd-c4-tabbed-header-renderer {
    background-color: #111111;
}

/* WEBKIT-SCROLLBAR */
  ::-webkit-scrollbar,
  ::-webkit-scrollbar-corner {
    background: #ddd;
    width: 14px;
    height: 14px;
  }
  ::-webkit-scrollbar-button {
    display: none;
  }
  ::-webkit-scrollbar-thumb {
    background: #aaa;
  }
  ::-webkit-scrollbar-thumb:not(:active):hover {
    background: #afafaf;
  }
  ::-webkit-scrollbar-thumb:active,
  ::-webkit-scrollbar-thumb:hover:active {
    background: #bbb;
  }
  [dark]::-webkit-scrollbar,
  [dark]::-webkit-scrollbar-corner,
  [dark] ::-webkit-scrollbar,
  [dark] ::-webkit-scrollbar-corner {
    background: #040406 !important;
  }
  [dark]::-webkit-scrollbar-button,
  [dark] ::-webkit-scrollbar-button {
    display: none;
  }
  [dark]::-webkit-scrollbar-thumb,
  [dark] ::-webkit-scrollbar-thumb {
    background: #333;
  }
  [dark]::-webkit-scrollbar-thumb:not(:active):hover,
  [dark] ::-webkit-scrollbar-thumb:not(:active):hover {
    background: #383838;
  }
  [dark]::-webkit-scrollbar-thumb:active,
  [dark]::-webkit-scrollbar-thumb:hover:active,
  [dark] ::-webkit-scrollbar-thumb:active,
  [dark] ::-webkit-scrollbar-thumb:hover:active {
    background: #5c5c5c;
  }
  
  /* VARS */
  :not([style-scope]):not(.style-scope) {
    --ytd-masthead-height: 64px; /* default: 56px */
  }
  
  /* PAGE-PROGRESS */
  yt-page-navigation-progress, #progress.yt-page-navigation-progress {
    height: 4px;
  }
  yt-page-navigation-progress {
    background-color: transparent;
  }
  
  /* MASTERHEAD */
  #container.ytd-masthead {
    height: 64px;
  }
  ytd-searchbox.ytd-masthead {
    justify-content: center !important;
  }
  #search-form.ytd-searchbox {
    height: 38px;
    box-shadow: 0 2px 2px 0 rgba(0,0,0,0.16), 0 0 0 1px rgba(0,0,0,0.08);
    transition: box-shadow .2s var(--standard-curve);
  }
  [has-focus] #search-form.ytd-searchbox {
    box-shadow: 0 3px 8px 0 rgba(0,0,0,0.2), 0 0 0 1px rgba(0,0,0,0.08);
  }
  #container.ytd-searchbox,
  #search-icon-legacy.ytd-searchbox {
    background: var(--yt-searchbox-background) !important;
    border: none !important;
    border-radius: 0 !important;
    box-shadow: none !important;
  }
  ytd-searchbox input {
    margin-left: 8px;
  }

  /* MASTERHEAD - SEARCHRESULTS */
  [dark] .gsfs {
    color: var(--grey-100);
  }
  [dark] .sbdd_b,
  [dark] .sbsb_a,
  [dark] .sbfl_b {
    background: var(--grey-750);
  }
  [dark] .sbsb_d {
    background: var(--grey-850);
  }
  [dark] .sbdd_b {
    border: none;
  }
  [dark] .sbfl_b:hover {
  	color: var(--white);
  }
  
  /* GUIDE */
  #header.ytd-app {
    height: 64px;
  }
  
  /* SUB-BUTTON */
  paper-button.ytd-subscribe-button-renderer[subscribed] .deemphasize.yt-formatted-string,
  paper-button.ytd-subscribe-button-renderer[subscribed] {
    color: var(--yt-subscribe-button-text-color);
  }
  paper-button.ytd-subscribe-button-renderer[subscribed] {
    background-color: var(--already-sub);
  }
  ytd-subscribe-button-renderer[button-style="COMPACT_GRAY"] paper-button.ytd-subscribe-button-renderer {
    background-color: var(--already-sub);
    color: var(--yt-subscribe-button-text-color);
  }

paper-button.ytd-subscribe-button-renderer {
    background-color: var(--no-sub);
}
  
  /* TOGGLE */
  .toggle-bar.paper-toggle-button {
    opacity: 0.3 !important;
  }
  paper-toggle-button[checked]:not([disabled]) .toggle-bar.paper-toggle-button {
    opacity: 0.7 !important;
  }


